  return (
    <div>
      <Menu mode="horizontal">
        <Menu.Item>
          
      <Link href="/">
        <a>메인화면</a>
      </Link>
        </Menu.Item>
        <Menu.Item>
          
        </Menu.Item>
        <Menu.Item>
          
        </Menu.Item>
      </Menu>
      <Link href="/profile">
        <a>프로필</a>
      </Link>
      <Link href="/signup">
        <a>회원가입</a>
      </Link>
      {children}
    </div>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
